import React from 'react'

export default function Discard() {
  return (
    <div className='discard'>
        {/* <div className='black-screen'></div> */}
        <h2>Discard Post</h2>
        <h4>If u leave, your edits won't be saved.</h4>
        <button>Discard</button>
        <button>Cancel</button>
    </div>
  )
}
